const project = (lat, lng, rotationX, rotationY, radius) => {
  const lambda = (lng + rotationX) * Math.PI / 180;
  const phi = lat * Math.PI / 180;
  const gamma = rotationY * Math.PI / 180;
  
  let x = Math.cos(phi) * Math.sin(lambda);
  let y = -Math.sin(phi);
  let z = Math.cos(phi) * Math.cos(lambda);
  
  const y2 = y * Math.cos(gamma) - z * Math.sin(gamma);
  const z2 = y * Math.sin(gamma) + z * Math.cos(gamma);
  
  return { x: x * radius, y: y2 * radius, visible: z2 > 0, depth: z2 };
};

const coordsToPath = (coords, rotationX, rotationY, radius) => {
  let path = '';
  let lastVisible = false;
  for (let i = 0; i < coords.length; i++) {
    const [lng, lat] = coords[i];
    const { x, y, visible } = project(lat, lng, rotationX, rotationY, radius);
    if (visible) {
      path += (lastVisible ? 'L' : 'M') + x.toFixed(1) + ',' + y.toFixed(1) + ' ';
      lastVisible = true;
    } else {
      lastVisible = false;
    }
  }
  if (path) path += 'Z';
  return path;
};

export default function GustoGlobe({ isOpen = true, onClose, onSelectCountry, onAskQuestion, inline = false }) {
  const [rotationX, setRotationX] = useState(10);
  const [rotationY, setRotationY] = useState(0);
  const [zoom, setZoom] = useState(1);
  const [isDragging, setIsDragging] = useState(false);
  const [selectedCountry, setSelectedCountry] = useState(null);
  const [selectedCity, setSelectedCity] = useState(null);
  const [hoveredCountry, setHoveredCountry] = useState(null);
  const lastPos = useRef({ x: 0, y: 0 });
  
  const canvasSize = 650;
  const globeSize = 650;
  const radius = globeSize * 0.42;
  const center = globeSize / 2;
  const ink = '#2D2A26';
  const paper = '#FAF7F2';
  const ocean = '#FDF9F3';
  const land = '#F0EBE1';
  const highlight = '#E07A5F';
  const cityColor = '#C17767';

  const onMouseDown = (e) => { 
    setIsDragging(true); 
    lastPos.current = { x: e.clientX, y: e.clientY }; 
  };
  
  const onMouseMove = (e) => { 
    if (!isDragging) return;
    const dx = e.clientX - lastPos.current.x;
    const dy = e.clientY - lastPos.current.y;
    lastPos.current = { x: e.clientX, y: e.clientY };
    const sensitivity = 0.5 / zoom;
    setRotationX(r => r + dx * sensitivity);
    setRotationY(r => Math.max(-90, Math.min(90, r - dy * sensitivity)));
  };
  
  const onMouseUp = () => setIsDragging(false);
  
  const onWheel = (e) => {
    e.preventDefault();
    setZoom(z => Math.max(1, Math.min(8, z - e.deltaY * 0.002)));
  };
  
  const onTouchStart = (e) => { 
    setIsDragging(true); 
    lastPos.current = { x: e.touches[0].clientX, y: e.touches[0].clientY }; 
  };
  
  const onTouchMove = (e) => { 
    if (!isDragging) return;
    const dx = e.touches[0].clientX - lastPos.current.x;
    const dy = e.touches[0].clientY - lastPos.current.y;
    lastPos.current = { x: e.touches[0].clientX, y: e.touches[0].clientY };
    const sensitivity = 0.5 / zoom;
    setRotationX(r => r + dx * sensitivity);
    setRotationY(r => Math.max(-90, Math.min(90, r - dy * sensitivity)));
  };
  
  const countryPaths = useMemo(() => {
    return countriesData.map(country => {
      const paths = country.p.map(poly => coordsToPath(poly, rotationX, rotationY, radius)).filter(p => p.length > 0);
      const centroidProj = project(country.c[1], country.c[0], rotationX, rotationY, radius);
      return {
        name: country.n,
        shortName: shortNames[country.n] || country.n,
        id: country.id,
        labelLevel: country.l,
        paths,
        centroid: centroidProj,
        visible: paths.length > 0 && centroidProj.visible
      };
    }).filter(c => c.paths.length > 0);
  }, [rotationX, rotationY, radius]);
  
  const cityPoints = useMemo(() => {
    return citiesData.map(city => {
      const proj = project(city.coord[1], city.coord[0], rotationX, rotationY, radius);
      return { ...city, proj };
    }).filter(c => c.proj.visible && c.proj.depth > 0.3);
  }, [rotationX, rotationY, radius]);

  const viewBoxSize = globeSize / zoom;
  const viewBoxOffset = (globeSize - viewBoxSize) / 2;
  
  const info = selectedCountry ? countryInfo[selectedCountry] : null;
  
  const depthThreshold = zoom >= 3 ? 0.3 : 0.6;
  const fontSize = Math.max(4, 7 / zoom);
  const showCities = selectedCountry && zoom >= 2.5;

  if (!isOpen) return null;

  // Inline mode: globe with panel below
  if (inline) {
    return (
      <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', gap: 24 }}>
        <svg
          width={canvasSize}
          height={canvasSize}
          viewBox={`0 0 ${globeSize} ${globeSize}`}
          style={{ cursor: isDragging ? 'grabbing' : 'grab' }}
          onMouseDown={onMouseDown}
          onMouseMove={onMouseMove}
          onMouseUp={onMouseUp}
          onMouseLeave={onMouseUp}
          onWheel={onWheel}
          onTouchStart={onTouchStart}
          onTouchMove={onTouchMove}
          onTouchEnd={onMouseUp}
        >
          <style>{`
            .country-path { transition: fill 0.15s; cursor: pointer; }
            .country-path:hover { fill: rgba(224, 122, 95, 0.25) !important; }
          `}</style>
          <defs>
            <clipPath id="globe-clip-inline">
              <circle cx={0} cy={0} r={radius} />
            </clipPath>
          </defs>
          <circle cx={center} cy={center} r={radius} fill={ocean} stroke={ink} strokeWidth={0.3} />
          <g transform={`translate(${center},${center})`} clipPath="url(#globe-clip-inline)">
            {countryPaths.filter(c => c.visible && c.centroid.depth > 0).map(({ name, paths, id }) => (
              <g key={id} onClick={() => setSelectedCountry(name)} onMouseEnter={() => setHoveredCountry(name)} onMouseLeave={() => setHoveredCountry(null)}>
                {paths.map((d, i) => (
                  <path
                    key={i}
                    className="country-path"
                    d={d}
                    fill={selectedCountry === name ? 'rgba(224, 122, 95, 0.35)' : land}
                    stroke={ink}
                    strokeWidth={0.25}
                    strokeLinejoin="round"
                  />
                ))}
              </g>
            ))}
            {hoveredCountry && countryPaths.filter(c => c.name === hoveredCountry && c.visible && c.centroid.depth > 0.6).map(({ name, shortName, centroid }) => (
              <text key={name + '-label'} x={centroid.x} y={centroid.y + 0.5} textAnchor="middle"
                style={{ fontFamily: "'Caveat', cursive", fontWeight: 600, fontSize: 8, fill: ink, pointerEvents: 'none' }}>
                {shortName}
              </text>
            ))}
          </g>
          <circle cx={center} cy={center} r={radius} fill="none" stroke={ink} strokeWidth={1.5} />
        </svg>

        {selectedCountry && (
          <div style={{ width: '100%', maxWidth: 500, background: 'white', borderRadius: 16, border: '2px solid ' + ink, padding: 20 }}>
            <CulinaryPanel
              country={selectedCountry}
              onClose={() => setSelectedCountry(null)}
              onAskQuestion={(question, context) => {
                if (onAskQuestion) onAskQuestion(question, context);
              }}
            />
          </div>
        )}
      </div>
    );
  }

  // Modal mode: full layout
  return (
    <div style={{ position: 'fixed', top: 0, left: 0, right: 0, bottom: 0, zIndex: 1000, background: paper, display: 'flex', flexDirection: 'column', alignItems: 'center', justifyContent: 'center', gap: 16, padding: 20 }}>
      <style>{`
        @import url('https://fonts.googleapis.com/css2?family=Caveat:wght@400;500;600&display=swap');
        .country-path { transition: fill 0.15s; cursor: pointer; }
        .country-path:hover { fill: rgba(224, 122, 95, 0.25) !important; }
        .city-dot { cursor: pointer; transition: r 0.15s; }
        .city-dot:hover { r: 3; }
      `}</style>

      <div style={{ width: '100%', display: 'flex', justifyContent: 'space-between', alignItems: 'center', maxWidth: 700 }}>
        <h1 style={{ fontFamily: "'Caveat', cursive", fontSize: 32, color: ink, margin: 0 }}>Gusto World</h1>
        {onClose && <button onClick={onClose} style={{ background: 'none', border: 'none', fontSize: 28, cursor: 'pointer', color: ink, lineHeight: 1 }}></button>}
      </div>

      <div style={{ display: 'flex', gap: 24, alignItems: 'flex-start', flexWrap: 'wrap', justifyContent: 'center' }}>
        <div
          style={{
            width: canvasSize,
            height: canvasSize,
            cursor: isDragging ? 'grabbing' : 'grab',
            userSelect: 'none',
            touchAction: 'none',
            borderRadius: 16,
            border: '2px solid ' + ink,
            overflow: 'hidden',
            background: paper,
            flexShrink: 0
          }}
          onMouseDown={onMouseDown}
          onMouseMove={onMouseMove}
          onMouseUp={onMouseUp}
          onMouseLeave={onMouseUp}
          onWheel={onWheel}
          onTouchStart={onTouchStart}
          onTouchMove={onTouchMove}
          onTouchEnd={onMouseUp}
        >
          <svg
            width={canvasSize}
            height={canvasSize}
            viewBox={`${viewBoxOffset} ${viewBoxOffset} ${viewBoxSize} ${viewBoxSize}`}
            style={{ background: paper }}
          >
            <circle cx={center} cy={center} r={radius} fill={ocean} stroke={ink} strokeWidth={Math.max(0.15, 0.3 / zoom)} />
            <g transform={`translate(${center},${center})`}>
              {countryPaths.filter(c => c.visible && c.centroid.depth > 0).map(({ name, paths, id }) => (
                <g key={id} onClick={() => { setSelectedCountry(name); setSelectedCity(null); if (onSelectCountry) { onSelectCountry(name); if (onClose) onClose(); } }} onMouseEnter={() => setHoveredCountry(name)} onMouseLeave={() => setHoveredCountry(null)}>
                  {paths.map((d, i) => (
                    <path
                      key={i}
                      className="country-path"
                      d={d}
                      fill={selectedCountry === name ? 'rgba(224, 122, 95, 0.35)' : land}
                      stroke={ink}
                      strokeWidth={Math.max(0.1, 0.25 / zoom)}
                      strokeLinejoin="round"
                    />
                  ))}
                </g>
              ))}
              
              {/* Country label - only show on hover */}
              {!selectedCountry && hoveredCountry && countryPaths.filter(c => c.name === hoveredCountry && c.visible && c.centroid.depth > depthThreshold).map(({ name, shortName, centroid }) => (
                <g key={name + '-label'}>
                  <text x={centroid.x} y={centroid.y + 0.5} textAnchor="middle"
                    style={{ fontFamily: "'Caveat', cursive", fontWeight: 600, fontSize: Math.max(5, 8 / zoom), fill: ink, pointerEvents: 'none' }}>
                    {shortName}
                  </text>
                </g>
              ))}
              
              {/* Cities */}
              {showCities && cityPoints.filter(c => c.country === selectedCountry).map((city, i) => (
                <g key={city.name + '-' + i} onClick={(e) => { e.stopPropagation(); setSelectedCity(city); setSelectedCountry(city.country); }}>
                  <circle 
                    className="city-dot"
                    cx={city.proj.x} 
                    cy={city.proj.y} 
                    r={Math.max(0.6, 1 / zoom)}
                    fill={selectedCity?.name === city.name ? highlight : cityColor} opacity={selectedCity?.name === city.name ? 1 : 0.7}
                    stroke={ink}
                    strokeWidth={0.2 / zoom}
                  />
                  {zoom >= 3.5 && (
                    <text 
                      x={city.proj.x + 2 / zoom} 
                      y={city.proj.y + 1 / zoom}
                      style={{ fontFamily: "'Caveat', cursive", fontSize: Math.max(2.5, 4 / zoom), fill: ink, pointerEvents: 'none' }}
                    >
                      {city.name}
                    </text>
                  )}
                </g>
              ))}
            </g>
            <circle cx={center} cy={center} r={radius} fill="none" stroke={ink} strokeWidth={Math.max(0.8, 1.5 / zoom)} />
          </svg>
        </div>
        
        {/* Info Panel - only in modal mode */}
        {!inline && (
          <div style={{
            width: 280,
            minHeight: 200,
            background: 'white',
            borderRadius: 16,
            border: '2px solid ' + ink,
            padding: 20,
            fontFamily: "'Caveat', cursive",
          }}>
            {selectedCity ? (
              <>
                <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: 12 }}>
                  <h2 style={{ fontSize: 26, color: ink, margin: 0 }}>
                     {selectedCity.name}
                  </h2>
                  <button onClick={() => setSelectedCity(null)}
                    style={{ background: 'none', border: 'none', fontSize: 20, cursor: 'pointer', color: ink }}></button>
                </div>
                <p style={{ fontSize: 16, color: ink, opacity: 0.7, margin: '4px 0' }}>{selectedCity.country}</p>
                <p style={{ fontSize: 18, color: ink, margin: '12px 0 4px' }}><strong>Specialit locale:</strong></p>
                <p style={{ fontSize: 20, color: highlight, margin: '4px 0' }}>{selectedCity.food}</p>
              </>
            ) : selectedCountry ? (
              <CulinaryPanel
                country={selectedCountry}
                onClose={() => setSelectedCountry(null)}
                onAskQuestion={(question, context) => {
                  if (onAskQuestion) {
                    onAskQuestion(question, context);
                  }
                  if (onClose) onClose();
                }}
              />
            ) : (
              <div style={{ textAlign: 'center', color: ink, opacity: 0.6 }}>
                <p style={{ fontSize: 48, margin: '20px 0' }}></p>
                <p style={{ fontSize: 20 }}>Clicca su un paese per scoprire i piatti tipici!</p>
                {hoveredCountry && (
                  <p style={{ fontSize: 24, marginTop: 16, opacity: 1, color: highlight }}>{hoveredCountry}</p>
                )}
              </div>
            )}
          </div>
        )}
      </div>
      
      {!inline && (
        <>
          <div style={{ display: 'flex', gap: 16, alignItems: 'center' }}>
            <button onClick={() => setZoom(z => Math.min(8, z + 0.5))}
              style={{ fontFamily: "'Caveat', cursive", fontSize: 24, background: 'none', border: '1px solid ' + ink, borderRadius: 8, padding: '4px 12px', cursor: 'pointer', color: ink }}>+</button>
            <span style={{ fontFamily: "'Caveat', cursive", fontSize: 16, color: ink, opacity: 0.7 }}>{Math.round(zoom * 100)}%</span>
            <button onClick={() => setZoom(z => Math.max(1, z - 0.5))}
              style={{ fontFamily: "'Caveat', cursive", fontSize: 24, background: 'none', border: '1px solid ' + ink, borderRadius: 8, padding: '4px 12px', cursor: 'pointer', color: ink }}>-</button>
          </div>
          <p style={{ fontFamily: "'Caveat', cursive", fontSize: 16, color: ink, opacity: 0.5 }}>trascina per ruotare  scroll per zoom  clicca paese o citt</p>
        </>
      )}
    </div>
  );
}
